import React from "react";
import firebase from "./initFirebase";

type weatherState = {
  rawData: any;
};

export default class WeatherPage extends React.Component<{}, weatherState> {
  constructor(props: any) {
    super(props);
    this.state = { rawData: [] };

    this.getRawData = this.getRawData.bind(this);
  }
  componentDidMount() {
    this.getRawData();
  }

  getRawData() {
    var tempsRef = firebase.database().ref("/temps/");
    tempsRef.on("value", (snapshot) => {
      this.setState({ rawData: Object.entries(snapshot.val()) });
      // console.log(snapshot.val());
    });
    console.log("got data");
  }
  makeSVG() {
    return <svg style={{ border: "2px solid gold" }}></svg>;
  }

  render() {
    return (
      <div>
        weather page
        <div>
          {this.makeSVG()}
          {this.state.rawData.map((entry: any) => (
            <div>{entry[0] + " " + entry[1][0]} </div>
          ))}
        </div>
      </div>
    );
  }
}

